import {
  Navbar,
  BigSidebar,
  FlashSales,
} from './components';
import { Hero } from './pages/Dashboard';
import { iphones } from './components/Data';
import Carousel from './components/Carousel';
import Card from './components/Card';


function App() {
  return (
    <>
      <Navbar />
      <BigSidebar images={iphones} />
      <FlashSales />
      <Carousel data={Card} />
    </>
  );
}

export default App;
